def run():
    url = interface + '/run_script'
    username = get_random_str(10)
    password = get_random_str(10)
    data = {
        "username":username,
        "password":password,
        "rememberMe":True,
        "market":"US",
        "transactionSubType":"signin",
        "reputation":{
            "ccAgentName":"WebApp",
            "platform":"Web",
            "market":"US",
            "deviceFingerprint":""
        }
    }
    data = {
        "match_url": "/bff/account/signin",
        "url": "https://www.starbucks.com/bff/account/signin",
        "method": "POST",
        "data": json.dumps(data, separators=(',', ':')),
    }
    s = requests.post(url, data=data).json()
    if s['status'] == 'success':
        s = s['message']
        if s['method'] == 'GET':
            url = s['url']
            method = s['method']
            headers = s['headers']
            print(url)
            print(method)
            pprint.pprint(headers)
            s = requests.get(url, headers=headers)
        elif s['method'] == 'POST':
            url = s['url']
            method = s['method']
            data = s['postData']
            headers = s['headers']
            print(url)
            print(method)
            print(data)
            pprint.pprint(headers)
            proxies = {'http':'http://127.0.0.1:7890', 'https':'http://127.0.0.1:7890'}
            proxies = None
            s = requests.post(url, headers=headers, data=data, proxies=proxies, timeout=15)
        print(s)
        print(s.text)
    else:
        print(s['message'])


